import React from 'react';
import { BrowserRouter, Route } from "react-router-dom";

// 기존 컴포넌트
import Main from './pages/main';

// 새로운 App 구성
const App = () => {
  return (
    <BrowserRouter>
          <Route path="/" element={<Main />} />
    </BrowserRouter>
  );
};

export default App;
